import React from 'react'
import Highcharts from 'highcharts';
import HighchartsReact from 'highcharts-react-official';

const options = {
    
    chart: {
        type: 'spline'
      },
    title: {
      text: ''
    },

    series: [{
        name: 'Population',
        data: [1, 2, 1, 4, 3, 6],
        color:'blue',
        dataLabels: {
            enabled: false,
            
            color: '#FFFFFF',
            align: 'right',
            x: -60,
            y: 20,
            style: {
                fontSize: '13px',
                fontFamily: 'Verdana, sans-serif'
            }
        }
    },
    {
        data: [1, 2, 1, 5, 3, 6]
    }

]

  }
class LineChart1 extends React.Component{
    constructor(){
        super()
    }
render(){
    return(
        <div>
    <HighchartsReact
      highcharts={Highcharts}
      options={options}
    />

        </div>
    )
}
}
export default LineChart1;
